import React from 'react';
import useStyles from './styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const TrackProducts = ({props}) => {
  const classes = useStyles();

  const rows = [
    createData('Bitcoin',10,10,1,2,'Crypto.com'),
    createData('Ada',237,9.0,37,10,'Robinhood'),
    createData('Doged',262,16.0,24,5,'Coinbase'),
    createData('Shiba Inu',305,3.7,67,4,'BlockFi'),
    createData('Ethereum Classic',356,16.0,49,1,'CoinMarketCap'),
  ];

  function createData(coinName, totalCoins, totalInvestment, avgCost, currentPrice, totalReturn, exchange) {
    return {
      coinName,
      totalCoins,
      totalInvestment,
      avgCost,
      currentPrice,
      totalReturn,
      exchange,
      /*this will move to redux store*/
      details: [
        // {taxed: 'Y', deposit: 'Y', noOfDepositCoins: '250', contractPeriod: '3 months',apy: '2%', netProfit: '1000', alarm:'Y'},
        // {taxed: 'N', deposit: 'N', noOfDepositCoins: '250', contractPeriod: 'Nan',apy: '2%', netProfit: '1000', alarm: 'N'},
        {taxed: 'Y', netProfit: '1000', alarm:true},
        {taxed: 'N', netProfit: '1000', alarm:false},
      ],
    };
  }

return(
  <TableContainer component={Paper}>
  <Table aria-label="collapsible table">
    <TableHead>
      <TableRow>
        <TableCell />
        <TableCell>Coin</TableCell>
        <TableCell>Total Coins</TableCell>
        <TableCell>Total Investment&nbsp;($)</TableCell>
        <TableCell>Avg Original Cost&nbsp;($)</TableCell>

        <TableCell>Current Price&nbsp;($)</TableCell>
        <TableCell>Total Return&nbsp;($) </TableCell>
        <TableCell>Exchange</TableCell>
      </TableRow>
    </TableHead>
    <TableBody>
      {/* Create Row */}
      {rows.map((row) => (
        <AddRowsData key={row.name} row={row} />
      ))}
    </TableBody>
  </Table>
</TableContainer>
);
}
export default TrackProducts;
export {TrackProducts};
